import { Navbar } from "../Layout/Navbar";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { getAllMaps } from "./HomeBehavior";
import "./style.css";

export const HomePage = () => {
  let nav = useNavigate();
  const [GetAllmap, setGetAllMap] = useState([]);

  const getAllMap = async () => {
    try {
      const getMap = await getAllMaps();

      if (getMap.success) {
        setGetAllMap(getMap.Map_of_User.Maps);
      }
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    // if (!localStorage.getItem("token")) {
    //   return nav("/login");
    // }
    getAllMap();
    console.log("Map", GetAllmap);
  });
  return (
    <>
      <Navbar></Navbar>

      <div>
        <div class="dropdown" style={{ pos: "auto" }}>
          <a
            class="btn btn-secondary dropdown-toggle"
            href="#"
            role="button"
            id="dropdownMenuLink"
            data-bs-toggle="dropdown"
            aria-expanded="false"
          >
            Create Board
          </a>

          <ul class="dropdown-menu" aria-labelledby="dropdownMenuLink">
            <li>
              <a class="dropdown-item" href="#">
                Action
              </a>
            </li>
            <li>
              <a class="dropdown-item" href="#">
                Another action
              </a>
            </li>
            <li>
              <a class="dropdown-item" href="#">
                Something else here
              </a>
            </li>
          </ul>
        </div>
        <div className="shadow cssforUl">
          {GetAllmap &&
            GetAllmap.map((item, index) => (
              <div class="shadow cssforUl-li card">
                <img
                  class="card-img-top"
                  src="https://www.gettyimages.in/gi-resources/images/Homepage/Hero/UK/CMS_Creative_164657191_Kingfisher.jpg"
                  alt=""
                />
                <div class="card-body">
                  <h5 class="card-title" style={{ color: "black" }}>
                    {GetAllmap[index].name}
                  </h5>
                </div>
                <div class="card-footer text-muted">Footer cá»§a Card</div>
              </div>
            ))}
        </div>
      </div>
    </>
  );
};
